// @flow strict

// Components
import { PokemonArchive } from '../components/PokemonArchive';

// Styles
import css from '../assets/sass/main.scss';

// Page
const Page = ({ anchor, pokemon }: Props) => {
	return (
		<React.Fragment>
			<main>
				<PokemonArchive anchor={anchor} pokemon={pokemon} />
			</main>
		</React.Fragment>
	)
}

// Props
Page.getInitialProps = async function() {
	const anchor = React.createRef();
	const pokemon = await fetch('https://pokeapi.co/api/v2/pokemon')
		.then(res => res.json());

	console.log(anchor);

	return { anchor, pokemon };
}

// Export
export default Page;
